const Target = () => {
    return (
        <div className="Target">
            <div className="whole">
                <form onSubmit={handleSubmit} className="form_container">
                    <div className="signup_texfield">
                        <div className="head">
                            <h2>이름을 입력해주세요</h2>
                        </div>
                        <TextField
                            value={sendData.name}
                            label="이름"
                            required
                            name="name"
                            margin="normal"
                            fullWidth
                            autoFocus
                            error={nameErrors && sendData.name !== ""}
                            onChange={(e) => {
                                onchange(e);
                                checkName(e);
                            }}
                            helperText={
                                nameErrors && sendData.name !== ""
                                    ? "올바른 이름을 입력해주세요."
                                    : null
                            }
                        />
                    </div>
                    <div className="signup_texfield">
                        <div className="head">
                            <h2>아이디를 입력해주세요</h2>
                        </div>
                        <TextField
                            value={sendData.id}
                            label="아이디"
                            required
                            name="id"
                            margin="normal"
                            fullWidth
                            autoFocus
                            error={idErrors && sendData.id !== ""}
                            onChange={(e) => {
                                onchange(e);
                                checkId(e);
                            }}
                            helperText={
                                idErrors && sendData.id !== ""
                                    ? "올바른 아이디를 입력하세요"
                                    : null
                            }
                        />
                    </div>
                    <SignupModal
                        isSuccess={isSuccess}
                        isError={!idErrors && !nameErrors}
                        validateCredentials={validateCredentials}
                        handleClose={() => setIsSuccess(false)}
                        sendData={sendData}
                    />
                    <Button
                        className="submit_button"
                        type="submit"
                        fullWidth
                        variant="contained"
                        sx={{ mt: 3, mb: 2 }}
                    >
                        Join
                    </Button>
                </form>
            </div>
        </div>
    );
};

export default Target;
